  render() {
    // console.log(this.props.categories);
    return (
      <div>

        <div>
          <button> ‚áê </button>
          <div> Past 30 Days </div>
          <button> Edit </button>
          <button onClick={this.handleClickDeleteCategory}> Delete </button>
        </div>

        <div>
          <div> Category Color Title </div>
          <div>
            <div>
              <div> Expense Date </div>
              <div> Expense Description </div>
              <div> Expense Amount </div>
            </div>
          </div>
        </div>

      </div>
    );
  }
}

const mapStateToProps = state => {
  return {
    categories: state.categoryReducer.category
  }
}

const mapDispatchToProps = dispatch => {
  return {
    getCategories: () => getCategories(dispatch),
    deleteCategory: category => deleteCategory(category, dispatch)
  }
}

export default connect(mapStateToProps, mapDispatchToProps)(CategoryDetails)
